import React from 'react';
import Hero from '../components/Hero';
import Projects from '../components/Projects';

function Home() {
  return (
    <>
      <section className="hero-section">
        <Hero />
      </section>

      <section className="projects-section">
        <Projects />
      </section>
    </>
  );
}


export default Home;
